import Information from './Information';
import './menuoverview.css';

const MenuOverview = () => {
  return (
    <div className="menu-overview">
      <h1>Menu Overview</h1>
      <Information caseValue="A" />
      <Information caseValue="B" />
      {/* Render more instances of Information component with different caseValue if needed */}
    </div>
  );
};

export default MenuOverview;
